import React from 'react';
import ReactDOM from 'react-dom/client';
import './ChatContent'
import ChatContent from './ChatContent';

var chat_content = [
    {
        "type":1,
        "content":"Hello"
    },
    {
        "type":0,
        "content":"Xin Chao"
    }
];

var sendMessage = function () {

}

var generateMessage = function () {
    var getContent = {
        "type": 1,
        "content": "ss"
    }
    chat_content.push(getContent);
    debugger;
    return (
        <>
            {chat_content.map(
                (c) => <ChatContent message={c} />
            )}
        </>
    );
}

function Chat() {
    return (
        <div class="chat">
            <div class="chat-header clearfix">
                <div class="row">
                    <div class="col-lg-6">
                        <a href="javascript:void(0);" data-toggle="modal" data-target="#view_info">
                            <img src="images/ai_agent.avif" alt="avatar" />
                        </a>
                        <div class="chat-about">
                            <h6 class="m-b-0">AI Agent</h6>
                            <small>Last seen: Online</small>
                        </div>
                    </div>
                </div>
            </div>
            <div class="chat-history" id="chat-context">
                <ul class="m-b-0">
                    <li class="clearfix">
                        <div class="message other-message float-right"> Hi Aiden, how are you? How is the
                            project coming along? </div>
                    </li>
                    <li class="clearfix">
                        <div class="message my-message">Are we meeting today?</div>
                    </li>
                </ul>
            </div>
            <div class="chat-message clearfix">
                <div class="input-group mb-0">
                    <div class="input-group-prepend">
                        <span class="input-group-text" onClick={generateMessage}><i class="fa fa-send"></i></span>
                    </div>
                    <input type="text" class="form-control" placeholder="Enter text here..." />
                </div>
            </div>
        </div>
    );
}

export default Chat;
